import React from 'react';
import Navbar from './Navbar';

function Dashboard() {
	return (
		<div className='dash-containter'>
			<div className='row align-items-start'>
				<div id='nav-section' className='col-3'>
					<Navbar />
				</div>
				<div className='col-9'>Test</div>
			</div>
		</div>
	);
}

export default Dashboard;
